import React from 'react'

function NavRight() {
  return (
    <div className='nav-right bg-yellow w-full lg:w-[80%] p-4'>
        <section>
            <div className='w-[60%] border'></div>
            <div className='w-'></div>
        </section>
    </div>
  )
}

export default NavRight
